import React, { useEffect, useState } from 'react';
import { sampleExpenses, categories } from '../utils/dummyData';
import { PieChart, Pie, Cell, Tooltip, Legend, ResponsiveContainer, LineChart, Line, XAxis, YAxis, CartesianGrid } from 'recharts';
import InsightsCard from '../components/InsightsCard';

const COLORS = ['#0088FE','#00C49F','#FFBB28','#FF8042','#a28','#888'];

export default function Dashboard() {
  const [expenses, setExpenses] = useState(() => {
    try { return JSON.parse(localStorage.getItem('cc_expenses')) || sampleExpenses; } catch { return sampleExpenses; }
  });

  useEffect(()=>{ localStorage.setItem('cc_expenses', JSON.stringify(expenses)); }, [expenses]);

  const byCategory = categories.map(cat => {
    const total = expenses.filter(e=>e.category===cat).reduce((s,i)=>s+i.amount,0);
    return { name: cat, value: total };
  }).filter(c=>c.value>0);

  const trend = [ {month:'Aug', amt:400}, {month:'Sep', amt:800}, {month:'Oct', amt: expenses.reduce((s,i)=>s+i.amount,0)} ];

  return (
    <div className="page">
      <h2>Overview</h2>
      <div className="grid-3">
        <div className="card">
          <h3>Total Spent</h3>
          <p className="big">${expenses.reduce((s,i)=>s+i.amount,0).toFixed(2)}</p>
        </div>

        <div className="card">
          <h3>Top Category</h3>
          <p className="big">{byCategory.sort((a,b)=>b.value-a.value)[0]?.name || '—'}</p>
        </div>

        <div className="card">
          <h3>Active Goals</h3>
          <p className="big">{(JSON.parse(localStorage.getItem('cc_goals')||'[]')).length}</p>
        </div>
      </div>

      <div className="grid-2">
        <div className="card chart-wrap">
          <h4>Spending by Category</h4>
          <ResponsiveContainer width="100%" height={250}>
            <PieChart>
              <Pie data={byCategory} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={80} label>
                {byCategory.map((entry, index) => <Cell key={index} fill={COLORS[index % COLORS.length]} />)}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>

        <div className="card chart-wrap">
          <h4>Monthly Trend</h4>
          <ResponsiveContainer width="100%" height={250}>
            <LineChart data={trend}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="amt" stroke="#8884d8" />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>

      <InsightsCard title="Quick Tip">
        <p>If food spending is high, try cooking 3 times a week — small changes add up.</p>
      </InsightsCard>
    </div>
  );
}
